/*Table structure for table `ecs_goods` */

DROP TABLE IF EXISTS `ecs_goods`;

CREATE TABLE `ecs_goods` (
  `goods_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `cat_id` smallint(5) unsigned NOT NULL DEFAULT '0',
  `goods_sn` varchar(60) NOT NULL DEFAULT '',
  `goods_name` varchar(120) NOT NULL DEFAULT '',
  `goods_name_style` varchar(60) NOT NULL DEFAULT '+',
  `click_count` int(10) unsigned NOT NULL DEFAULT '0',
  `sales_count` int(10) unsigned NOT NULL DEFAULT '0',
  `brand_id` smallint(5) unsigned NOT NULL DEFAULT '0',
  `provider_name` varchar(100) NOT NULL DEFAULT '',
  `goods_number` smallint(5) unsigned NOT NULL DEFAULT '0',
  `goods_weight` decimal(10,3) unsigned NOT NULL DEFAULT '0.000',
  `market_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00',
  `shop_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00',
  `promote_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00',
  `promote_start_date` int(11) unsigned NOT NULL DEFAULT '0',
  `promote_end_date` int(11) unsigned NOT NULL DEFAULT '0',
  `warn_number` tinyint(3) unsigned NOT NULL DEFAULT '1',
  `keywords` varchar(255) NOT NULL DEFAULT '',
  `goods_brief` varchar(255) NOT NULL DEFAULT '',
  `goods_desc` text NOT NULL,
  `goods_thumb` varchar(255) NOT NULL DEFAULT '',
  `goods_img` varchar(255) NOT NULL DEFAULT '',
  `original_img` varchar(255) NOT NULL DEFAULT '',
  `is_real` tinyint(3) unsigned NOT NULL DEFAULT '1',
  `extension_code` varchar(30) NOT NULL DEFAULT '',
  `is_on_sale` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `is_alone_sale` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `is_shipping` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `integral` int(10) unsigned NOT NULL DEFAULT '0',
  `add_time` int(10) unsigned NOT NULL DEFAULT '0',
  `sort_order` smallint(4) unsigned NOT NULL DEFAULT '100',
  `is_delete` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `is_best` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `is_new` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `is_hot` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `is_promote` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `bonus_type_id` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `last_update` int(10) unsigned NOT NULL DEFAULT '0',
  `goods_type` smallint(5) unsigned NOT NULL DEFAULT '0',
  `seller_note` varchar(255) NOT NULL DEFAULT '',
  `give_integral` int(11) NOT NULL DEFAULT '-1',
  `rank_integral` int(11) NOT NULL DEFAULT '-1',
  `suppliers_id` smallint(5) unsigned DEFAULT NULL,
  `is_check` tinyint(1) unsigned DEFAULT NULL,
  `goods_shipai` text NOT NULL,
  `comments_number` int(10) unsigned NOT NULL DEFAULT '0',
  `sales_volume` int(10) unsigned NOT NULL DEFAULT '0',
  `bb_chicun` char(28) NOT NULL,
  `mobile_desc` text,
  `sales_volume_base` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '销量基数',
  `fencheng` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`goods_id`),
  KEY `goods_sn` (`goods_sn`),
  KEY `cat_id` (`cat_id`),
  KEY `last_update` (`last_update`),
  KEY `brand_id` (`brand_id`),
  KEY `goods_weight` (`goods_weight`),
  KEY `promote_end_date` (`promote_end_date`),
  KEY `promote_start_date` (`promote_start_date`),
  KEY `goods_number` (`goods_number`),
  KEY `sort_order` (`sort_order`),
  KEY `sales_volume` (`sales_volume`)
) ENGINE=MyISAM AUTO_INCREMENT=163 DEFAULT CHARSET=utf8;

/*Data for the table `ecs_goods` */

insert  into `ecs_goods`(`goods_id`,`cat_id`,`goods_sn`,`goods_name`,`goods_name_style`,`click_count`,`sales_count`,`brand_id`,`provider_name`,`goods_number`,`goods_weight`,`market_price`,`shop_price`,`promote_price`,`promote_start_date`,`promote_end_date`,`warn_number`,`keywords`,`goods_brief`,`goods_desc`,`goods_thumb`,`goods_img`,`original_img`,`is_real`,`extension_code`,`is_on_sale`,`is_alone_sale`,`is_shipping`,`integral`,`add_time`,`sort_order`,`is_delete`,`is_best`,`is_new`,`is_hot`,`is_promote`,`bonus_type_id`,`last_update`,`goods_type`,`seller_note`,`give_integral`,`rank_integral`,`suppliers_id`,`is_check`,`goods_shipai`,`comments_number`,`sales_volume`,`bb_chicun`,`mobile_desc`,`sales_volume_base`,`fencheng`) values (1,44,'ECS000000','希思黎轻柔护肤西柚柔肤水250ml','+',595,28,0,'',995,'0.110','620.00','399.00','0.00',0,0,1,'LG 3g 876 支持 双模 2008年04月 灰色 GSM,850,900,1800,1900','平衡肌肤PH值，及时补充水分，给予肌肤清新舒爽的感受！','<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 很多朋友都已经抢先体验了3G网络的可视通话、高速上网等功能。LG KD876手机<span style=\"font-size: x-large;\"><span style=\"color: rgb(255, 0, 0);\"><strong>支持TD-SCDMA/GSM双模单待</strong></span></span>，便于测试初期GSM网络和TD网络之间的切换和共享。</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; LG KD876手机整体采用银色塑料材质，<strong><span style=\"font-size: x-large;\"><span style=\"color: rgb(255, 0, 0);\">特殊的旋转屏设计是本机的亮点</span></span></strong>，而机身背部的300万像素摄像头也是首发的六款TD-SCDMA手机中配置最高的。LG KD876手机屏幕下方设置有外键盘，该键盘由左/右软键、通话/挂机键、返回键、五维摇杆组成，摇杆灵敏度很高，定位准确。KD876的内键盘由标准12个电话键和三个功能键、一个内置摄像头组成。三个功能键分别为视频通话、MP3、和菜单键，所有按键的手感都比较一般，键程适中，当由于按键排列过于紧密，快速发短信时很容易误按，用户在使用时一定要多加注意。LG KD876手机机身周边的接口设计非常简洁，手机的厚度主要来自屏幕旋转轴的长度，如果舍弃旋屏设计的话，估计<span style=\"font-size: x-large;\"><strong><span style=\"color: rgb(255, 0, 0);\">厚度可以做到10mm以下</span></strong></span>。</p>','images/201311/thumb_img/1_thumb_G_1384988540522.gif','images/201311/goods_img/1_G_1384988540180.jpg','images/201311/source_img/1_G_1384988540259.jpg',1,'',1,1,0,3,1240902890,1,0,0,0,1,0,0,1387156979,9,'',-1,-1,0,0,'',0,6,'','',0,NULL),(4,8,'ECS000004','诺基亚N85原装充电器','+',51,4,1,'',17,'0.000','69.60','58.00','0.00',0,0,1,'','','','images/200905/thumb_img/4_thumb_G_1241422402467.jpg','images/200905/goods_img/4_G_1241422402722.jpg','images/200905/source_img/4_G_1241422402919.jpg',1,'',1,0,0,0,1241422402,100,0,0,0,0,0,0,1242110662,6,'',-1,-1,0,0,'',0,0,'','',0,NULL),(3,8,'ECS000002','诺基亚原装5800耳机','+',24,1,1,'',24,'0.000','81.60','68.00','0.00',0,0,1,'','','','images/200905/thumb_img/3_thumb_G_1241422082679.jpg','images/200905/goods_img/3_G_1241422082168.jpg','images/200905/source_img/3_G_1241422082367.jpg',1,'',1,1,0,0,1241422082,100,0,0,0,0,0,0,1241972255,6,'',-1,-1,0,0,'',0,0,'','',0,NULL),(5,11,'ECS000005','索爱原装M2卡读卡器','+',128,16,7,'',8,'0.000','24.00','20.00','0.00',0,0,1,'','','','images/200905/thumb_img/5_thumb_G_1241422518886.jpg','images/200905/goods_img/5_G_1241422518773.jpg','images/200905/source_img/5_G_1241422518470.jpg',1,'',1,1,0,0,1241422518,100,0,1,1,0,0,0,1241972241,2,'',-1,-1,0,0,'',0,0,'','',0,NULL),(6,11,'ECS000006','胜创KINGMAX内存卡','+',2,0,0,'',15,'0.000','50.40','42.00','0.00',0,0,1,'','','','','','',1,'',1,0,0,0,1241422573,100,0,0,0,0,0,0,1241972238,6,'',-1,-1,0,0,'',0,0,'','',0,NULL),(7,8,'ECS000007','诺基亚N85原装立体声耳机HS-82','+',12,0,1,'',20,'0.000','120.00','100.00','0.00',0,0,1,'','','','images/200905/thumb_img/7_thumb_G_1241422785492.jpg','images/200905/goods_img/7_G_1241422785856.jpg','images/200905/source_img/7_G_1241422785657.jpg',1,'',1,1,0,1,1241422785,100,0,0,0,0,0,0,1241972232,2,'',-1,-1,0,0,'',0,0,'','',0,NULL),(8,3,'ECS000008',' 香奈儿coco小姐唇膏（62#）3g','+',63,1,19,'',1,'0.075','300.00','238.00','0.00',0,0,1,'双模 2008年春 黑色 直板 中低档','独特色彩因子和柔软细腻质地，赋予双唇丝般的润泽效果及迷人光彩！','<p align=\"left\">作为一款性价比极高的入门级<font size=\"3\" color=\"#ff0000\"><strong>商务手机</strong></font>，飞利浦<a href=\"mailto:9@9v\">Xenium&nbsp; 9@9v</a>三围大小为105&times;44&times;15.8mm，机身重量仅为<strong><font size=\"3\" color=\"#ff0000\">75g</font></strong>，装配了一块低规格1.75英寸128&times;160像素65000色CSTN显示屏。身正面采用月银色功能键区与屏幕数字键区相分隔，键盘设计较为<font size=\"3\"><strong><font color=\"#ff0000\">别</font><font color=\"#ff0000\">致</font></strong></font>，中部导航键区采用钛金色的&ldquo;腰带&rdquo;彰显出浓郁的商务气息。</p>\r\n<p align=\"left\">&nbsp;</p>\r\n<p align=\"left\">此款手机采用<strong><font size=\"3\" color=\"#ff0000\">触摸屏</font></strong>设计，搭配精致的手写笔，可支持手写中文和英文两个版本。增强的内置系统还能识别潦草字迹，确保在移动中和匆忙时输入文字的识别率。手写指令功能还支持特定图案的瞬间调用，独特的手写记事本功能，可以在触摸屏上随意绘制个性化的图案并进行<strong><font size=\"3\" color=\"#ff0000\">记事提醒</font></strong>，让商务应用更加随意。</p>\r\n<p align=\"left\">&nbsp;</p>\r\n<p align=\"left\">&nbsp;作为入门级为数不多支持<strong><font size=\"3\" color=\"#ff0000\">双卡功能</font></strong>的手机，可以同时插入两张SIM卡，通过菜单随意切换，只需开启漫游自动切换模式，<a href=\"mailto:9@9V\">9@9V</a>在该模式下能够判断网络情况，自动切换适合的手机号。</p>\r\n<p align=\"left\">&nbsp;</p>\r\n<p align=\"left\">&nbsp;</p>','images/201311/thumb_img/8_thumb_G_1384988790593.gif','images/201311/goods_img/8_G_1384988790722.jpg','images/201311/source_img/8_G_1384988790762.jpg',1,'',1,1,0,2,1241425512,100,0,0,0,1,0,0,1385075894,9,'',-1,-1,0,0,'',0,0,'','',0,NULL),(9,23,'ECS000009','雅诗兰黛第六代特润精华露50ml','+',1054,49,2,'',1,'0.121','950.00','669.00','0.00',0,0,1,'SMS EMS MMS 短消息群发 语音 阅读器 SMS,EMS,MMS,短消息群发语音合成信息阅读器 黑色 白色 滑盖','No.1畅销精华，1滴，渗透滋润，立现柔滑细嫩，4周，隐退细纹，透现饱满光泽。','<p>在机身材质方面，诺基亚E66大量采用金属材质，刨光的金属表面光泽动人，背面的点状效果规则却又不失变化，时尚感总是在不经意间诠释出来，并被人们所感知。E66机身尺寸为<span style=\"color: rgb(255, 0, 0);\"><span style=\"font-size: larger;\"><strong>107.5&times;49.5&times;13.6毫米，重量为121克</strong></span></span>，滑盖的造型竟然比E71还要轻一些。</p>\r\n<p>&nbsp;</p>\r\n<div>诺基亚E66机身正面是<span style=\"color: rgb(255, 0, 0);\"><span style=\"font-size: larger;\"><strong>一块2.4英寸1600万色QVGA分辨率（240&times;320像素）液晶显示屏</strong></span></span>。屏幕上方拥有光线感应元件，能够自适应周 围环境光调节屏幕亮度；屏幕下方是方向功能键区。打开滑盖，可以看到传统的数字键盘，按键的大小、手感、间隔以及键程适中，手感非常舒适。</div>\r\n<div>&nbsp;</div>\r\n<div>诺基亚为E66配备了一颗320万像素自动对焦摄像头，带有LED 闪光灯，支持多种拍照尺寸选择。</div>\r\n<p>&nbsp;</p>','images/201311/thumb_img/9_thumb_G_1384987018566.gif','images/201311/goods_img/9_G_1384987018919.jpg','images/201311/source_img/9_G_1384987018328.jpg',1,'',1,1,0,6,1241511871,0,0,0,0,1,0,0,1385072461,9,'',-1,-1,0,0,'',6,3,'','',0,NULL),(10,49,'ECS000010','思亲肤90度卷长睫毛膏10g','+',236,25,24,'',5,'0.000','78.00','49.90','0.00',0,0,1,'2008年05月 GSM,850,900,1800,1900 直板 黑色 白色','香蕉90度卷长睫毛膏 天然腊和高机能的特殊支撑成分，能有效支撑下垂的睫毛，立即呈现90度放大的亮眼。','<p>C702可以说是一种在外观上复古的产物，不仅延续T系列早期的直板造型，而且在屏幕和键盘的组合分布上都继承了前辈的精髓。C702的机身尺寸为106&times;48&times;15.5毫米，重量为105克。此外索尼爱立信为C702融入了<font size=\"3\" color=\"#ff0000\"><strong>三防特性，即防尘、防滑和防水溅</strong></font>，这款新的C702搭载了索尼爱立信经典A200平台，界面布局与W908c、K858c一致，典型的特征就是配备左右软键、中央确定键和通话/挂机键。</p>\r\n<p>索尼爱立信C702配备一块<strong><font size=\"3\" color=\"#ff0000\">2.2英寸26万色TFT液晶显示屏</font></strong>，分辨率为240&times;320像素(QVGA)，显示效果属于目前主流水准。C702可以说是索尼爱立信首批<strong><font size=\"3\" color=\"#ff0000\">内置GPS模块</font></strong>的 手机产品之一，C702的搜星、定位一气呵成，十分精准，误差大约在10米之内。基本上定位后可以将有效卫星数量控制在4&mdash;6颗，可以说可以满足我们的需 要了。C702还提供了&ldquo;影像定位&rdquo;功能，配合内置的AGPS全球定位辅助系统，只须启动Geo-Tagging智能影像定位功能，便可将拍摄地点记录在 照片内，方便用户随时查询。</p>\r\n<p>&nbsp;</p>\r\n<p>作为一款Cyber-shot系列影像手机，索尼爱立信C702在拍照功能方面同样有不俗的表现。并且手机内置的<strong><font size=\"3\" color=\"#ff0000\">320万像素摄像头</font></strong>也 同样在拍照功能上也不错的表现。不仅支持自动聚焦和双LED闪光功能，而且还拥有2倍数码变焦、防红眼、Photo fix优画及场景模式等功能。索尼爱立信C702除了配备的是最大光圈为F3.2的4.2毫米镜头之外，该机也如同门中的旗舰C902一样增加了对脸部有 先自动聚焦功能的支持。</p>\r\n<p>&nbsp;</p>','images/201311/thumb_img/10_thumb_G_1385076352897.jpg','images/201311/goods_img/10_G_1385076352496.jpg','images/201311/source_img/10_G_1385076352790.png',1,'',1,1,0,0,1241965622,100,0,0,0,1,0,0,1390430692,9,'',-1,-1,0,0,'',0,0,'','',0,NULL),(11,3,'ECS000011','索爱C702c','+',0,0,7,'',1,'0.000','0.00','1300.00','0.00',0,0,1,'直板','','','','','',1,'',0,1,0,0,1241966951,100,1,0,0,0,0,0,1241966960,7,'',-1,-1,0,0,'',0,0,'','',0,NULL),(12,24,'ECS000012','雅顿保湿调理露200ml','+',400,22,13,'',3000,'0.000','200.00','78.00','0.00',0,0,1,'SMS EMS MMS pda 摄像 智能 音乐 SMS,EMS,MMS','使肌肤光滑水嫩， 补充水份，提升肌肤自身的保湿能力，让肌肤由内而外水嫩光彩。','<p>全机使用的材质除去电池盖部分采用了金属以外，其它均使用了ABS工程塑料作为主材，这款手机的三围是105&times;51&times;14毫米，有着100克的轻量级重量，拿在手中的感觉还是非常不错的。A810手机作为一款<strong><font size=\"3\" color=\"#ff0000\">PDA手机</font></strong>在设计的时候取消了键盘配置，一切数字键都要依靠手机内提供的虚拟键盘进行操作，在手机的左上侧是一个<strong><font size=\"3\" color=\"#ff0000\">3.5mm的标准耳机插口</font></strong>，这种设计可以让用户使用自己习惯或者喜欢的耳机去欣赏音乐。</p>\r\n<p>&nbsp;</p>\r\n<p>这款摩托罗拉A810手机配置了一块<font size=\"3\" color=\"#ff0000\"><strong>26万色的2.2英寸TFT全触摸屏幕</strong></font>，其分辨率达到了主流的QVGA水平（240&times;320像素），摩托罗拉A810采用了内部核心为2.6.10的<strong><font size=\"3\" color=\"#ff0000\">LINUX操作系统</font></strong>，菜单上依然采用传统的9宫格的显示方式，一般手机的名片式电话本只能支持诸如电话、邮件、传真、公司等一些基本信息，而A810手机的电话本除了这些还支持公司地址，配偶信息、子女姓名、上司名称、助手等等，对于一款手机来说，电话本不可谓不强大。A810的<strong><font size=\"3\" color=\"#ff0000\">手写识别能力相当的惊人</font></strong>，对连笔、草书和倒插笔的识别率都相当的高，同时还为左右手设置了不同的书写习惯选择，并支持手写速度的调节。</p>\r\n<p>这款A810手机<strong><font size=\"3\" color=\"#ff0000\">内置的音乐播放功能</font></strong>可以支持MP3、WAV、AMR、AAC等格式的音乐播放，<font size=\"3\" color=\"#ff0000\"><strong>支持后台播放</strong></font>。视频方面，这款A810支持MP4、3GP、H.263格式的播放，视频播放器同样简约，操作方便，这款摩托罗拉A810还内置了6款游戏，每一款都有很高的耐玩性，而且都是支持触摸屏操作的，同时这款手机还内置了<strong><font size=\"3\" color=\"#ff0000\">FM收音机</font></strong>，支持自动搜索，并提供了20个频道供用户存储，不过收音机并不支持后台播放。</p>\r\n<p>&nbsp;</p>','images/201311/thumb_img/12_thumb_G_1384995644320.jpg','images/201311/goods_img/12_G_1384995644760.jpg','images/201311/source_img/12_G_1384995644283.jpg',1,'',1,1,0,0,1245297652,100,0,0,1,0,0,0,1390430843,11,'',-1,-1,0,0,'',0,0,'','',0,NULL),(13,52,'ECS000013','欧莱雅绝配无暇粉底液N1#象牙色','+',59,1,23,'',8,'0.000','198.00','109.00','0.00',0,0,1,'摄像 智能 音乐 蓝色 红色 舒适 直板 中档 2008年07月 黑色 GSM,850,900,1800,1900','','<p>诺基亚5320XpressMusic音乐手机采用XpressMusic系列常见的黑红、黑蓝配色方案，而材质方便则选用的是经过<strong><font size=\"3\" color=\"#ff0000\">抛光处理</font></strong>的工程塑料；三围/体重为，为108&times;46&times;15mm/<strong><font size=\"3\" color=\"#ff0000\">90g</font></strong>，手感舒适。</p>\r\n<p>&nbsp;</p>\r\n<p>诺基亚5320采用的是一块可视面积为2.0英寸的<font size=\"3\" color=\"#ff0000\"><strong>1600万色</strong></font>屏幕，分辨率是常见的240&times;320像素（QVGA）。虽然屏幕不是特别大，但效果非常精细，色彩还原不错。</p>\r\n<p>&nbsp;</p>\r\n<p>手机背面，诺基亚为5320XM配备一颗<strong><font size=\"3\" color=\"#ff0000\">200W像素</font></strong>的摄像头，并且带有<strong><font size=\"3\" color=\"#ff00